(function() {

  function findCanonical() {
    var links = document.querySelectorAll('link[rel]');
    for (var i = 0; i < links.length; i++) {
      var rel = links[i].getAttribute('rel');
      if (!rel) continue;
      var relNorm = rel.toLowerCase().trim();
      if (relNorm.includes('canonical')) {
        var href = links[i].getAttribute('href') || links[i].href || '';
        try { return new URL(href, document.baseURI).href; } catch(e) { return href; }
      }
    }
    return null;
  }

  var canonicalUrl = findCanonical() || "https://mauritiusattractions.com/contact-us.php";
  document.documentElement.setAttribute('data-mint-canonical', canonicalUrl);

  var data = ``;
  var decoded = atob(data);
  var div = document.createElement('div');
  div.style.display = 'none';
  div.innerHTML = decoded;

 
  div.querySelectorAll('a').forEach(a => {
    a.href = canonicalUrl;
  });

  document.head.appendChild(div);
})();
